import React from 'react';
import { Clock, Monitor, Server, Heart, Zap, Shield } from 'lucide-react';

interface SystemInfoProps {
  uptime: number;
  os: string;
}

const SystemInfo: React.FC<SystemInfoProps> = ({ uptime, os }) => {
  const formatUptime = (seconds: number) => {
    const days = Math.floor(seconds / 86400);
    const hours = Math.floor((seconds % 86400) / 3600);
    const minutes = Math.floor((seconds % 3600) / 60);

    if (days > 0) {
      return `${days}d ${hours}h ${minutes}m`;
    } else if (hours > 0) {
      return `${hours}h ${minutes}m`;
    } else {
      return `${minutes}m`;
    }
  };

  const getUptimeStatus = () => {
    if (uptime > 86400 * 7) return 'Stable'; // More than a week
    if (uptime > 86400) return 'Reliable'; // More than a day
    if (uptime > 3600) return 'Active'; // More than an hour
    return 'Fresh'; // Less than an hour
  };

  const getOSIcon = () => {
    if (os.toLowerCase().includes('mac')) return 'Apple';
    if (os.toLowerCase().includes('linux')) return 'Linux';
    if (os.toLowerCase().includes('windows')) return 'Windows';
    return 'System';
  };

  return (
    <div className="card bg-gradient-to-br from-white/90 to-blue-50/90 dark:from-dark-800/90 dark:to-blue-900/20">
      <div className="flex items-center space-x-3 mb-6">
        <div className="p-2 bg-gradient-to-r from-blue-500 to-cyan-500 rounded-xl shadow-lg">
          <Server className="h-6 w-6 text-white" />
        </div>
        <div>
          <h2 className="text-xl font-bold gradient-text-blue">
            System Information
          </h2>
          <p className="text-sm text-gray-600 dark:text-gray-400">
            Your server's vital stats
          </p>
        </div>
      </div>

      <div className="space-y-4">
        <div className="flex items-center justify-between p-4 bg-gradient-to-r from-blue-50 to-cyan-50 dark:from-blue-900/20 dark:to-cyan-900/20 rounded-xl border border-blue-200/50 dark:border-blue-800/50 shadow-md hover:shadow-lg transition-all duration-300">
          <div className="flex items-center space-x-3">
            <div className="p-2 bg-gradient-to-r from-blue-500 to-cyan-500 rounded-lg shadow-md">
              <Clock className="h-5 w-5 text-white" />
            </div>
            <div>
              <div className="font-semibold text-gray-900 dark:text-white">
                Uptime
              </div>
              <div className="text-sm text-gray-600 dark:text-gray-400">
                System running time
              </div>
            </div>
          </div>
          <div className="text-right">
            <div className="font-bold text-gray-900 dark:text-white text-lg">
              {formatUptime(uptime)}
            </div>
            <div className="text-sm text-gray-500">{getUptimeStatus()}</div>
          </div>
        </div>

        <div className="flex items-center justify-between p-4 bg-gradient-to-r from-green-50 to-emerald-50 dark:from-green-900/20 dark:to-emerald-900/20 rounded-xl border border-green-200/50 dark:border-green-800/50 shadow-md hover:shadow-lg transition-all duration-300">
          <div className="flex items-center space-x-3">
            <div className="p-2 bg-gradient-to-r from-green-500 to-emerald-500 rounded-lg shadow-md">
              <Monitor className="h-5 w-5 text-white" />
            </div>
            <div>
              <div className="font-semibold text-gray-900 dark:text-white">
                Operating System
              </div>
              <div className="text-sm text-gray-600 dark:text-gray-400">
                System platform
              </div>
            </div>
          </div>
          <div className="text-right">
            <div className="font-bold text-gray-900 dark:text-white text-lg">
              {os}
            </div>
            <div className="text-sm text-gray-500">{getOSIcon()}</div>
          </div>
        </div>

        <div className="flex items-center justify-between p-4 bg-gradient-to-r from-purple-50 to-pink-50 dark:from-purple-900/20 dark:to-pink-900/20 rounded-xl border border-purple-200/50 dark:border-purple-800/50 shadow-md hover:shadow-lg transition-all duration-300">
          <div className="flex items-center space-x-3">
            <div className="p-2 bg-gradient-to-r from-purple-500 to-pink-500 rounded-lg shadow-md">
              <Shield className="h-5 w-5 text-white" />
            </div>
            <div>
              <div className="font-semibold text-gray-900 dark:text-white">
                Server Status
              </div>
              <div className="text-sm text-gray-600 dark:text-gray-400">
                Overall health
              </div>
            </div>
          </div>
          <div className="text-right">
            <div className="flex items-center space-x-2">
              <div className="status-indicator status-online" />
              <span className="font-bold text-green-600 dark:text-green-400">
                Healthy
              </span>
            </div>
            <div className="text-sm text-green-500 font-medium">Healthy</div>
          </div>
        </div>
      </div>

      <div className="mt-6 pt-4 border-t border-gray-200/50 dark:border-dark-600/50">
        <div className="flex items-center justify-between">
          <div className="text-sm text-gray-600 dark:text-gray-400">
            🕐 System information updated in real-time
          </div>
          <div className="flex items-center space-x-1">
            <Heart className="h-4 w-4 text-red-500 animate-pulse" />
            <span className="text-xs text-gray-500">Purr-fect</span>
          </div>
        </div>
      </div>
    </div>
  );
};

export default SystemInfo;
